import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../firebase/AuthContext.jsx";
import { Menu, X } from "lucide-react"; // icon library

export default function Navbar() {
  const { user, role } = useAuth();
  const navigate = useNavigate();

  const isAdmin = role === "admin";
  const [mobileOpen, setMobileOpen] = useState(false);

  const handleLogout = async () => {
    const { logout } = await import("../firebase/auth.js");
    await logout();
    navigate("/login");
  };

  return (
    <>
      {/* NAVBAR */}
      <nav className="navbar-wrapper">
        <div className="navbar-container">

          {/* LOGO AREA */}
          <Link
            to="/"
            className="flex items-center gap-3 navbar-logo animate-logo"
            onClick={() => setMobileOpen(false)}
          >
            <img
              src="/logo-nav.png"
              alt="HI AWTO Logo"
              className="h-14 w-auto"
            />
          </Link>

          {/* DESKTOP LINKS */}
          <div className="hidden md:flex gap-8 items-center navbar-links">
            <Link to="/" className="nav-link">Home</Link>

            {user && (
              <>
                <Link to="/my-listings" className="nav-link">My Listings</Link>
                <Link to="/messages" className="nav-link">Messages</Link>
                <Link to="/profile" className="nav-link">Profile</Link>
              </>
            )}

            {user && isAdmin && (
              <Link to="/admin/messages" className="nav-link-admin">Admin</Link>
            )}

            {!user && (
              <>
                <Link to="/login" className="nav-link">Login</Link>
                <Link to="/register" className="nav-link">Register</Link>
              </>
            )}

            {user && (
              <button
                onClick={handleLogout}
                className="nav-link-logout"
              >
                Logout
              </button>
            )}
          </div>

          {/* MOBILE MENU ICON */}
          <button
            className="md:hidden mobile-menu-button"
            onClick={() => setMobileOpen(!mobileOpen)}
          >
            {mobileOpen ? <X size={28} /> : <Menu size={28} />}
          </button>
        </div>

        {/* MOBILE DROPDOWN MENU */}
        {mobileOpen && (
          <div className="mobile-menu fade-in-down">
            <Link to="/" onClick={() => setMobileOpen(false)} className="mobile-item">Home</Link>

            {user && (
              <>
                <Link to="/my-listings" onClick={() => setMobileOpen(false)} className="mobile-item">My Listings</Link>
                <Link to="/messages" onClick={() => setMobileOpen(false)} className="mobile-item">Messages</Link>
                <Link to="/profile" onClick={() => setMobileOpen(false)} className="mobile-item">Profile</Link>
              </>
            )}

            {user && isAdmin && (
              <Link to="/admin/messages" onClick={() => setMobileOpen(false)} className="mobile-item text-green-600">Admin</Link>
            )}

            {!user && (
              <>
                <Link to="/login" onClick={() => setMobileOpen(false)} className="mobile-item">Login</Link>
                <Link to="/register" onClick={() => setMobileOpen(false)} className="mobile-item">Register</Link>
              </>
            )}

            {user && (
              <button
                onClick={() => { handleLogout(); setMobileOpen(false); }}
                className="mobile-item text-red-600"
              >
                Logout
              </button>
            )}
          </div>
        )}
      </nav>
    </>
  );
}
